class Solution:
    def minimumOperationsToMakeEqual(self, x: int, y: int) -> int:
        from collections import deque

        def valid_next_steps(x):
            steps = [x - 1, x + 1]
            if x % 5 == 0:
                steps.append(x // 5)
            if x % 11 == 0:
                steps.append(x // 11)
            return steps

        queue = deque([(x, 0)]) # (current value, operations count)
        visited = set([x])

        while queue:
            current, ops = queue.popleft()
            if current == y:
                return ops

            for next_step in valid_next_steps(current):
                if next_step not in visited and 1 <= next_step <= 10**4:
                    visited.add(next_step)
                    queue.append((next_step, ops + 1))

        return -1
